    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE + 46 + - + col0 NOT BETWEEN col0 AND - - col0 * - + col0;
  - name: tab2

outputs:
  - name: q13388.out
    data: |
      46	51	23
      64	77	40
      75	67	58
